import React, { Component } from 'react'
import {Button, Container} from 'semantic-ui-react'



export class NavBar extends Component {
    render() {
        return (
            <div className="image">
                <Button.Group widths='2' fluid color="grey">
                    <Button>Login</Button>
                    <Button>Favorites</Button>
                </Button.Group>
                <img fluid src='https://images.unsplash.com/photo-1457369804613-52c61a468e7d?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&w=1000&q=80' alt="books" />
                    <h1><span>Welcome to Book Finder</span></h1>
            </div>
        )
    }
}

export default NavBar
